import React from 'react';
import './product-row.style.css'


const ProductRow = (props) => {
    return (
        <div className = {"product-row-container "+props.color}>
            <span className="">
                {props.name}
            </span>
            {
               props.grade < 3
               ?
               <span className="color-red">
               {' '}{props.grade}
               </span>
               :
               <span>
                    {' '}{props.grade}
                </span>
            }
            <span>
            {' '}{props.grade}
            </span>
            <span>
            {' '}{props.gender}
            </span>
        </div>

       // <SearchBar/>
    );
}

export default ProductRow ;
